import { useState } from 'react';
import {
  CheckIcon,
  CopilotIcon,
  SearchIcon,
  TriangleDownIcon,
  XIcon,
} from '@primer/octicons-react';
import {
  Box,
  Button,
  Heading,
  IconButton,
  Link,
  NavList,
  Text,
  TextInput,
} from '@primer/react';

export function Copilot() {
  const [isLoading, setIsLoading] = useState(false);

  return (
    <Box
      sx={{
        width: '100%',
      }}
    >
      <Box
        sx={{
          p: 2,
          border: '1px solid',
          borderColor: 'border.default',
          display: 'inline',
        }}
      >
        <CopilotIcon />
      </Box>
      <Heading
        as='h2'
        sx={{
          fontSize: 3,
          fontWeight: 400,
        }}
      >
        Copilot
      </Heading>
    </Box>
  );
}
